options.styles:
/* sheet background color */

.qvt-sheet {
    background-color: #F0F3F6 !important;
}

/* null value handling (make white and hide '-') */

.cell .null-value .value {
    color: #ffffff !important;
    background: #ffffff !important;
}

.qv-pt .cell.null-value {
    background-color: #ffffff;
}

.qv-pt .cell.empty.left:not(.top-meta).null-value,
.qv-pt .cell.parent.left.null-value {
    border-right-color: #ffffff;
}

.qv-pt .cell.empty.left:not(.top-meta).null-value,
.qv-pt .cell.parent.left.null-value {
    border-right-color: #ffffff;
}

.qv-pt .last-top-row {
    border-top: 1px solid #e6e6e6
}

.qv-st-data-cell-null-value {
    background-color: #ffffff !important;
    left: -99999px !important;
    position: relative !important;
}

/* custom container design */

.qs-container .lui-tab.lui {
    background-color: #D3D3D3 !important;
}

.qs-container .qsc-tab-row .lui-tab {
    background-color: #F0F3F6;
}

.qs-container .lui-tab.lui-active,
.qs-container .lui-tab.lui-focused,
.qs-container .lui-tab:focus {
    background-color: #006580 !important;
    border-bottom: none !important;
    box-shadow: 5px 0 5px -2px #888;
    z-index: 1;
}

.qs-container .qsc-tab-row .lui-tabset {
    background-color: #ffffff !important;
}

.qs-container .lui-tab.lui-active span,
.qs-container .lui-tab.lui-focused span,
.qs-container .lui-tab:focus span {
    color: white !important;
}

.qs-container .qsc-tab-row .lui-tab:not(:first-child) {
    border-left: 3px solid #E6E6E6 !important;
    border-radius: 10px 0px 0px 0px;
}

.qs-container .qsc-tab-row button.lui-button.dropdown {
    margin-left: 2px;
}

.qs-container .qsc-tab-row.hide-border,
.qv-client.qv-card .qs-container .qsc-tab-row {
    border-bottom: 2px solid #E6E6E6 !important;
}

.qs-container .qsc-tab-row button.lui-button.dropdown {
    margin-right: 5px !important;
}

/* hide multi-kpi since only used for CSS */

.qv-object-qlik-multi-kpi {
    display: none;
}

/* add box shadow to objects except for those within containers or filterpane panels */

.qv-object:not(:has(.qv-filterpane-collapsed)),
.qv-filterpane-collapsed {
    box-shadow: rgba(50, 50, 93, 0.25) 0px 2px 5px -1px, rgba(0, 0, 0, 0.3) 0px 1px 3px -1px !important;
}

.qv-object .qv-object {
    box-shadow: none !important;
}
